troca.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;IMPORTANTE:&lt;/span&gt; Antes de receber o novo produto, cupom de desconto ou estorno, o item trocado ou devolvido precisa chegar a nossa AssistÃªncia TÃ©cnica, onde serÃ¡ feito um processo de qualidade que pode levar atÃ© 20 dias Ãºteis para ser concluÃ­do. Caso a escolha seja por outro produto, serÃ¡ calculado o novo prazo de entrega.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Caso a assistÃªncia tÃ©cnica entenda que o produto devolvido nÃ£o compreende os critÃ©rios pontuados acima, o site fica dispensado de aceitar a devoluÃ§Ã£o ou fazer a troca. A OuroAF reenviarÃ¡ o produto ao cliente sem consulta prÃ©via, acompanhado da justificativa do motivo da recusa. &amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;h2&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Cancelamento&lt;/span&gt;&lt;/h2&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Nos casos de cancelamento de compras realizadas atravÃ©s de cartÃ£o de crÃ©dito, Ã© necessÃ¡rio entrar em contato com o nosso ServiÃ§o de Atendimento ao Cliente no e-mail sac@ouroaf.com solicitando o cancelamento imediato do pedido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;O cancelamento da compra pode ser feito dentro do prazo de atÃ© 7 dias corridos apÃ³s o recebimento do pedido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Nosso horÃ¡rio de atendimento Ã© de segunda a sexta-feira das 10:00 Ã s 19:00 horas (feriados).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;h2&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Politica de entrega&lt;/span&gt;&lt;/h2&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Antes do fechamento do pedido Ã© possÃ­vel saber o prazo de entrega acessando o seu âcarrinhoâ e informando o nÃºmero do seu CEP no campoâCalcule o freteâ. ApÃ³s fazer isso Ã© sÃ³ clicar no botÃ£o âCalcularâ e serÃ¡ exibido o tempo estimado de entrega para o CEP informado â tambÃ©m irÃ¡ constar o valor do frete a ser cobrado.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;O prazo de entrega dos seus pedidos varia de acordo com o endereÃ§o informado para entrega. O prazo sÃ³ comeÃ§a a ser contado a partir do momento em que o pagamento do pedido Ã© aprovado e Ã© verificada a disponibilidade do produto.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;O prazo de entrega que Ã© exibido no âcarrinhoâ Ã© calculado de acordo com a quantidade de itens no pedido e o endereÃ§o informado.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A inclusÃ£o de um produto no &quot;carrinho&quot; nÃ£o garante sua reserva. O produto somente estarÃ¡ reservado ao cliente apÃ³s a finalizaÃ§Ã£o do pedido e aprovaÃ§Ã£o pela operadora do cartÃ£o. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;ApÃ³s o fechamento do pedido serÃ¡ enviado uma mensagem para seu e-mail informando o tempo estimado de entrega.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;O recebimento do seu pedido poderÃ¡ ser feito por p